import json
import csv
import os
from datetime import datetime
from functools import wraps
from typing import Dict, List, Optional, Any, Union
import hashlib

class ErrorHandler:
    def __init__(self):
        self.validation_rules = {}

    def add_validation_rule(self, field: str, rule: callable):
        self.validation_rules[field] = rule

    def validate(self, data: Dict[str, Any]) -> Dict[str, List[str]]:
        errors = {}
        for field, rule in self.validation_rules.items():
            if field in data:
                if not rule(data[field]):
                    errors.setdefault(field, []).append(f"Validation failed for {field}")
        return errors

class FileHandler:
    ALLOWED_EXTENSIONS = {'.csv', '.json'}

    @staticmethod
    def validate_extension(filename: str) -> bool:
        _, ext = os.path.splitext(filename)
        return ext.lower() in FileHandler.ALLOWED_EXTENSIONS

    @staticmethod
    def read_csv(filepath: str) -> List[Dict[str, Any]]:
        with open(filepath, mode='r') as file:
            reader = csv.DictReader(file)
            return [row for row in reader]

    @staticmethod
    def read_json(filepath: str) -> Dict[str, Any]:
        with open(filepath, mode='r') as file:
            return json.load(file)

class DataCache:
    def __init__(self):
        self.cache = {}

    def add_to_cache(self, key: str, data: Any):
        self.cache[key] = data

    def get_from_cache(self, key: str) -> Optional[Any]:
        return self.cache.get(key)

class SubmissionManager:
    def __init__(self):
        self.submissions = {}
        self.statuses = {}

    def create_submission(self, submission_id: str, data: Any):
        self.submissions[submission_id] = data
        self.statuses[submission_id] = "created"

    def update_submission_status(self, submission_id: str, status: str):
        if submission_id in self.statuses:
            self.statuses[submission_id] = status

    def get_submission_status(self, submission_id: str) -> Optional[str]:
        return self.statuses.get(submission_id)

