class AgencyDataHandler:
    AGENCY_CODES = {
        'NASA': 'NAS',
        'NSF': 'NSF',
        'NIH': 'NIH'
    }

    def derive_agency_code(self, record: Dict[str, Any]) -> Optional[str]:
        agency_name = record.get('agency')
        return self.AGENCY_CODES.get(agency_name)

class UIPageManager:
    def __init__(self):
        self.pages = {}
        self.versions = {}

    def add_page(self, page_id: str, content: str):
        self.pages[page_id] = content
        self.versions[page_id] = 1

    def update_page(self, page_id: str, content: str):
        if page_id in self.pages:
            self.pages[page_id] = content
            self.versions[page_id] += 1

    def get_page_version(self, page_id: str) -> Optional[int]:
        return self.versions.get(page_id)

class QATester:
    def __init__(self):
