class BrokerUser:
    def __init__(self):
        self.file_handler = FileHandler()
        self.error_handler = ErrorHandler()
        self.agency_handler = AgencyDataHandler()

    def process_submission(self, filepath: str) -> Dict[str, Any]:
        if not self.file_handler.validate_extension(filepath):
            return {'error': 'Invalid file extension'}

        try:
            if filepath.endswith('.csv'):
                data = self.file_handler.read_csv(filepath)
            elif filepath.endswith('.json'):
                data = self.file_handler.read_json(filepath)
            else:
                return {'error': 'Unsupported file type'}

            errors = self.error_handler.validate(data if isinstance(data, dict) else data[0])
            if errors:
                return {'error': 'Validation failed', 'details': errors}

            agency_codes = [self.agency_handler.derive_agency_code(record) for record in (data if isinstance(data, list) else [data])]
            return {'success': True, 'data': data, 'agency_codes': agency_codes}

        except Exception as e:
            return {'error': str(e)}

class UIManager:
    def __init__(self):
        self.page_manager = UIPageManager()

    def update_page_design(self, page_id: str, content: str):
        self.page_manager.update_page(page_id, content)
        return f"Page {page_id} updated to version {self.page_manager.get_page_version(page_id)}"

class SystemUser:
    def __init__(self):
        self.error_handler = ErrorHandler()

    def process_file_with_error_handling(self, filepath: str) -> Dict[str, Any]:
        try:
            if not FileHandler.validate_extension(filepath):
                return {'error': 'Invalid file extension'}

            if filepath.endswith('.csv'):
                data = FileHandler.read_csv(filepath)
            elif filepath.endswith('.json'):
                data = FileHandler.read_json(filepath)
            else:
                return {'error': 'Unsupported file type'}

            return {'success': True, 'data': data}

        except Exception as e:
            return {'error': str(e)}
